      enable: false
      url: http://www.gstatic.com/generate_204
      interval: 300
      
# proxy groups
proxy-groups:
- name: LOADBALANCE
  type: load-balance
  strategy: round-robin
  disable-udp: false
  url: http://www.gstatic.com/generate_204
  interval: '300'
  use:
    - VPN
- name: BEST-PING
  type: url-test
  disable-udp: false
  url: http://www.gstatic.com/generate_204
  interval: '300'
  tolerance: '5'
  use:
    - VPN
- name: AKRAB
  type: select
  proxies:
    - LOADBALANCE
    - BEST-PING
    - DIRECT
- name: GAME
  type: select
  proxies:
    - LOADBALANCE
    - BEST-PING
    - DIRECT
- name: ADBLOCK
  type: select
  proxies:
    - LOADBALANCE
    - BEST-PING
    - REJECT
   
